INSERT INTO `request` (`rid`, `uid`, `title`, `description`, `location`, `jobdate`, `expirydate`, `category`) VALUES
(88, 169, 'Pool cleaner', 'Great opportunity. We are a local based pool maintenance company, looking for an enthusiastic person to join our busy team. Excellent working conditions. "experience preffered but NOT essential"', '{"coordinate":{"lat":48.24026113640709,"lng":16.36008158326149},"address":"Heiligenstädter Str. 50-52, 1190 Wien, Austria"}', '2017-08-10', '2017-08-31', 13),
(86, 169, 'Experienced Gardener ', 'We are seeking an experienced grounds operative to maintain the parks and open spaces in and around the local area.\n\nThe job involves the following aspects of garden maintenance:\n\nWeeding\nPruning\nPlanting\nLawn Moving\nStrimming\nA full driving license is required as the candidate will need to drive a small van, equipped with gardening tools.', '{"coordinate":{"lat":48.23067991599809,"lng":16.310138314765936},"address":"Klg Ober Alsegger Parz., 1170 Wien, Austria"}', '2017-12-08', '2017-09-01', 12),
(85, 167, 'Monthly Cleaning', 'I would like to hire a cleaner to come once a month and do basic cleaning plus additional cleaning when needed. ', '{"coordinate":{"lat":48.21647361225854,"lng":16.34617727996556},"address":"Mariannengasse 28, 1090 Wien, Austria"}', '2017-05-09', '2017-09-06', 12),
(84, 167, 'Babysitter Needed For 2 Children', 'I\'m looking for a great babysitter with a clean driving record to pick up my daughter from school on Tuesdays and Thursdays in September and transport my son to baseball games through October. Could possibly need someone longer than after October, but will know more once school starts. My daughter is 15 and my son is 11. They are extremely independent and great kids, but I really just need someone to pick them up, transport to activities, possibly do some homework, or drive to a voice or guitar lesson, since I commute 45 minutes - 1 hour from work to home. Typical hours would range in the 3:30 p.m. to 6:15 p.m. time frame.sgs ef adas', '{"coordinate":{"lat":48.241345453882055,"lng":16.382785677124048},"address":"Durchlaufstraße 23, 1200 Wien, Austria"}', '2017-04-09', '2018-12-25', 7);
INSERT INTO `offer` (`oid`, `uid`, `title`, `description`, `location`, `expirydate`, `category`, `realtime`) VALUES
(187, 170, 'Car Wash', 'At Car Wash in Wien we strive for a supreme quality cleaning of your automobile. We are about quality not quantity. We only use some of the best products on the commercial market. These include Auto Magic and Car Brite products. We know your going to love our work!', '{"coordinate":{"lat":48.227747,"lng":16.387340999999992},"address":"Taborstraße 102-108, 1020 Wien, Austria"}', '2018-03-05', 13, 0),
(185, 170, 'MONTHLY UNLIMITED CAR WASH PLANS', 'Car Wash offers four monthly Unlimited Wash plans:\n\nAce. Paradise foam shampoo, soft-cloth wash, spot-free rinse, rinse dry, and power dry.\nBoss. Everything you get with the Ace plan, plus tire and wheel cleaner and triple-foam conditioner.\nTop Dog. Everything you get with the Boss plan, plus clear-coat shine.\nBig Shot. Everything you get with the Top Dog plan, plus hand-applied tire dressing, Carnauba Extreme Shine wax, and Rain-X Complete surface protectant.', '{"coordinate":{"lat":48.227747,"lng":16.387340999999992},"address":"Taborstraße 102-108, 1020 Wien, Austria"}', '2018-02-02', 13, 0),
(183, 168, 'Restaurant Cleaning Services', 'sfasdf asdf ad ad asdas dasd asd as When the last table is bussed and the kitchen closes, CleanerPro’s restaurant cleaning teams go to work. Our crews are ready to provide the best in restaurant cleaning to make sure your kitchen and dining areas are clean, fresh and ready for the next day.\n\nWith professional restaurant cleaning services, your cooks will have a sanitized work environment and your guests an immaculate dining area. CleanerPro’s services include:\n\nA superior and cleaner restaurant, from kitchen to dining area\nDedicated and experienced staff\n24-hour operations support and measured inspections\nLearn more about our restaurant cleaning services by submitting your information for a free quote or contacting one of our local restaurant cleaning professionals today.\n\nGo with the CleanerPro.', '{"coordinate":{"lat":48.220973595230284,"lng":16.332083344459534},"address":"Beheimgasse 58, 1170 Wien, Austria"}', '2018-03-03', 7, 0),
(181, 168, 'Housekeeping/Home Cleaning/Maid Service', 'Coming home to a clean kitchen, freshly vacuumed floors and well-kept bathrooms gives us all a wonderful feeling. Molly Maid is the most well-known, trusted name in home cleaning services. For 30 years we’ve performed house cleaning services according to the wishes of our clients.\n \nOpen: 7/24', '{"coordinate":{"lat":48.180087506827284,"lng":16.415828883648942},"address":"Fuchsröhrenstraße 34, 1110 Wien, Austria"}', '2018-02-03', 13, 0);
